import React, {Component, useContext} from 'react';
import SignIn from "../components/SignIn";
import './home.css';
import {UserContext} from "../providers/UserProvider";

const Home = () => {
  const user = useContext(UserContext);
  let introUser;
  if(user !== null){
    introUser = <h1> Hello, {user.email} </h1>
  } else {
    introUser = <h1> hello! </h1>
  };
    return (
      <div>

        {introUser}
        <div className="w-2/5 mt-200px">
        <SignIn />
        </div>
      </div>
    )
  }


export default Home;
